import React from 'react';

const SearchBar = ({ query, setQuery }) => {
    return (
        <input 
            className=''
            type="text" 
            value={query}
            onChange={(e) => setQuery(e.target.value)}
            placeholder="Search for a book"
        />
    );
};

export default SearchBar;
